def binaryCompleteness(dat, metric, threshold):
    good = dat.filter(col(metric) < threshold)
    tp = good.filter(col('prediction') == 1).count()
    return tp/good.count()


def cross_entropy(dat, y_trueColumn = 'true', y_predColumn = 'prediction', probability = True):
    '''calculates Cross Entropy using Keras "binary_crossentropy" function.'''

    y_true = [i[0] for i in dat.select(y_trueColumn).toPandas().values]
    if probability:
        y_pred = [i[int(j)] for (i,j) in dat.select('probability', 'prediction')\
                                                    .toPandas().values]
    else: 
        y_pred = [i[0] for i in dat.select('prediction').toPandas().values]

    return binary_crossentropy(y_true = y_true, y_pred = y_pred)

def getPurity(dat, metric, threshold):
    good = dat.filter(col(metric) < threshold)
    tp = good.filter(col('prediction') == 1).count()
    return tp/dat.filter(col('prediction') == 1).count()

